tatus":"completed"},"tags":[]},"source":["## Transform datasets\n","\n","### Fix date and time formats "]},{"cell_type":"code","execution_count":9,"id":"975f7ffd","metadata":{"execution":{"iopub.execute_input":"2022-04-09T03:34:53.11846Z","iopub.status.busy":"2022-04-09T03:34:53.116902Z","iopub.status.idle":"2022-04-09T03:35:26.100902Z","shell.execute_reply":"2022-04-09T03:35:26.101432Z"},"papermill":{"duration":33.213096,"end_time":"2022-04-09T03:35:26.101594","exception":false,"start_time":"2022-04-09T03:34:52.888498","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["`summarise()` has grouped output by 'datetime', 'time'. You can override using the `.groups` argument.\n","\n"]}],"source":["# Fix datetime format\n","dailyActivity <- dailyActivity_raw\n","dailyActivity$ActivityDate <- mdy(dailyActivity$ActivityDate)\n","\n","# Add weekday column\n","dailyActivity <- dailyActivity %>% \n","  mutate(weekday = wday(ActivityDate, label = TRUE, abbr = TRUE))\n","\n","# Fix datetime format\n","minuteMET <- minuteMET_raw\n","minuteMET$ActivityMinute <- mdy_hms(minuteMET$ActivityMinute)\n","\n","# Separate date and time \n","minuteMET <- minuteMET %>% \n","  mutate(datetime = ActivityMinute) %>% \n","  separate(ActivityMinute, c(\"date\", \"time\"), sep = \" \")  \n","\n","# Fix class\n","minuteMET$date <- as_date(minuteMET$date)\n","minuteMET$time <- as_hms(minuteMET$time)\n","\n","# Fix datetime format, remove blank time, to date\n","dailySleep <- dailySleep_raw\n","date <- dailySleep$SleepDay\n","dailySleep$SleepDay <- mdy_hms(dailySleep$SleepDay)\n","dailySleep$SleepDay <- as_date(dailySleep$SleepDay)\n","\n","# Fix datetime format\n","hourlyIntensity <- hourlyIntensity_raw\n","hourlyIntensity$ActivityHour <- mdy_hms(hourlyIntensity$ActivityHour)\n","\n","# Fix datetime format\n","# Add weekday\n","# Separate date and time \n","# Intensity of the sample as a whole\n","hourlyIntensity <- hourlyIntensity %>% \n","  mutate(datetime = ActivityHour) %>% \n","  mutate(weekday = wday(ActivityHour, label = TRUE, abbr = TRUE)) %>% \n","  separate(ActivityHour, c(\"date\", \"time\"), sep = \" \") %>% \n","  group_by(datetime, time, weekday) %>% \n","  summarise(total_int = sum(TotalIntensity))\n","\n","# Fix time format\n","hourlyIntensity$time <- as_hms(hourlyIntensity$time)"]},{"cell_type":"markdown","id":"4bf060d3","metadata":{"papermill":{"duration":0.225301,"end_time":"2022-04-09T03:35:26.550543","exception":false,"start_time":"2022-04-09T03:35:26.325242","status":"completed"},"tags":[]},"source":["### Exercise distance \n","\n","NHS suggests adults to have 150 minutes of moderate exercise, or 75 minutes of vigorous exercise a week. \n","\n","Exercise distance is the moderate exercise distance plus vigorous exercise distance. exercise distance and exercise minutes for finding correlations with other factors. \n","\n","When 75 mins of vigorous exercise is equivalent to 150 mins of moderate exercise, adjusted exercise minutes of 2 * vigorous mins + 1 * moderate exercise is used for comparison. \n","\n","https://www.nhs.uk/live-well/exercise/"]},{"cell_type":"code","execution_count":10,"id":"db6df68d","metadata":{"execution":{"iopub.execute_input":"2022-04-09T03:35:27.014657Z","iopub.status.busy":"2022-04-09T03:35:27.01308Z","iopub.status.idle":"2022-04-09T03:35:27.05403Z","shell.execute_reply":"2022-04-09T03:35:27.052873Z"},"papermill":{"duration":0.271147,"end_time":"2022-04-09T03:35:27.054169","exception":false,"start_time":"2022-04-09T03:35:26.783022","status":"completed"},"tags":[]},"outputs":[],"source":["# Exclude columns won't be using\n","# Calculate distance during exercise\n","# Calculate device usage minutes\n","# Calculate adjusted exercise minutes\n","dailyActivity <- dailyActivity %>%\n","        select(-TrackerDistance, -LoggedActivitiesDistance) %>% \n","        mutate(exercise_distance = VeryActiveDistance + ModeratelyActiveDistance) %>% \n","        mutate(total_minutes = VeryActiveMinutes + FairlyActiveMinutes + LightlyActiveMinutes + SedentaryMinutes) %>% \n","        mutate(adjusted_exercise_minutes = VeryActiveMinutes * 2 + FairlyActiveMinutes) \n","\n","# Remove row if exercise distance is zero\n","# Remove row if adjusted exercise minutes is zero\n","dailyActivity <- dailyActivity %>% \n","  filter(exercise_distance != 0) %>% \n","  filter(adjusted_exercise_minutes != 0)"]},{"cell_type":"markdown","id":"0e302bce","metadata":{"papermill":{"duration":0.223287,"end_time":"2022-04-09T03:35:27.500636","exception":false,"start_time":"2022-04-09T03:35:27.277349","status":"completed"},"tags":[]},"source":["### MET minute\n","\n","Moderate exercise accounts for 3 to 6 MET minute. Vigorous exercise for over 6 MET minutes. \n","\n","For MET minute over 3, will count as exercising. \n","\n","Since number of days participated in the survey varies, average weekly exercise MET is calculated by total daily exercise MET / number of days participated * 7 \n","\n","https://www.hsph.harvard.edu/nutritionsource/staying-active/"]},{"cell_type":"code","execution_count":11,"id":"ca6db206","metadata":{"execution":{"iopub.execute_input":"2022-04-09T03:35:27.957311Z","iopub.status.busy":"2022-04-09T03:35:27.95516Z","iopub.status.idle":"2022-04-09T03:35:28.347828Z","shell.execute_reply":"2022-04-09T03:35:28.346436Z"},"papermill":{"duration":0.621804,"end_time":"2022-04-09T03:35:28.348021","exception":false,"start_time":"2022-04-09T03:35:27.726217","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["`summarise()` has grouped output by 'Id'. You can override using the `.groups` argument.\n","\n"]}],"source":["# Find total MET during exercise in a day\n","# Correct to actual MET value according to metadata PDF, prepare for calculations \n","minuteMET$METs <- minuteMET$METs / 10\n","\n","dailyMET <- minuteMET\n","dailyMET <- dailyMET %>% \n","  group_by(Id, date) %>% \n","  filter(METs > 3) %>%\n","  summarise(exerciseMET = sum(METs))\n","\n","# Add weekday \n","dailyMET$weekday <- wday(dailyMET$date, label = TRUE, abbr = TRUE)\n","\n","# Identify duration of exercise \n","minute_exerciseMET <- minuteMET\n","minute_exerciseMET <- minute_exerciseMET %>% \n","  filter(METs > 3) \n","\n","# Categorise exercise level \n","minute_exerciseMET <- minute_exerciseMET %>% \n","  mutate(\n","    exerciseLevel = case_when(\n","      METs <= 6 ~ \"moderate\", \n","      METs > 6 ~ \"vigorous\"\n","      )\n","    )\n","\n","# Find user average weekly MET\n","weeklyMET <- dailyMET\n","weeklyMET <- weeklyMET %>% \n","  group_by(Id) %>% \n","  summarise(num_days = n_distinct(date), avg_weekly_MET = sum(exerciseMET) / num_days * 7 )"]},{"cell_type":"markdown","id":"2193cad1","metadata":{"papermill":{"duration":0.223169,"end_time":"2022-04-09T03:35:28.796718","exception":false,"start_time":"2022-04-09T03:35:28.573549","status":"completed"},"tags":[]},"source":["### Daily intensity "]},{"cell_type":"code","execution_count":12,"id":"91f248c3","metadata":{"execution":{"iopub.execute_input":"2022-04-09T03:35:29.24976Z","iopub.status.busy":"2022-04-09T03:35:29.24774Z","iopub.status.idle":"2022-04-09T03:35:29.734367Z","shell.execute_reply":"2022-04-09T03:35:29.732126Z"},"papermill":{"duration":0.715153,"end_time":"2022-04-09T03:35:29.73452","exception":false,"start_time":"2022-04-09T03:35:29.019367","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["`summarise()` has grouped output by 'Id'. You can override using the `.groups` argument.\n","\n"]}],"source":["# Fix datetime format\n","dailyIntensity <- hourlyIntensity_raw\n","dailyIntensity$ActivityHour <- mdy_hms(dailyIntensity$ActivityHour)\n","\n","# Fix datetime format\n","# Add weekday\n","# Separate date and time \n","# Intensity of the sample as a whole\n","dailyIntensity <- dailyIntensity %>% \n","  mutate(datetime = ActivityHour) %>% \n","  separate(ActivityHour, c(\"date\", \"time\"), sep = \" \") %>% \n","  group_by(Id, date) %>% \n","  summarise(total_int = sum(TotalIntensity))\n","\n","# Fix time format\n","dailyIntensity$date <- as_date(dailyIntensity$date)"]},{"cell_type":"markdown","id":"f75bc05d","metadata":{"papermill":{"duration":0.227304,"end_time":"2022-04-09T03:35:30.188548","exception":false,"start_time":"2022-04-09T03:35:29.961244","status":"completed"},"tags":[]},"source":["### Fitness device usage duration \n","\n","Device usage time is the time participants wearing the device, which is equal to the total activity recorded in a day. \n","\n","Using over 0.75 of a day as high usage; over half a day as medium; less than half of a day, as low; less than 0.25 of a day as very low usage. "]},{"cell_type":"code","execution_count":13,"id":"5dafc771","metadata":{"execution":{"iopub.execute_input":"2022-04-09T03:35:30.646375Z","iopub.status.busy":"2022-04-09T03:35:30.644367Z","iopub.status.idle":"2022-04-09T03:35:30.670924Z","shell.execute_reply":"2022-04-09T03:35:30.669261Z"},"papermill":{"duration":0.257958,"end_time":"2022-04-09T03:35:30.671086","exception":false,"start_time":"2022-04-09T03:35:30.413128","status":"completed"},"tags":[]},"outputs":[],"source":["# Find device usage minutes\n","# Identify usage level\n","usage <- dailyActivity %>% \n","  select(Id, total_minutes) %>% \n","  group_by(Id) %>% \n","  summarise(usage_day = mean(total_minutes) / 1440) %>% \n","  mutate(usage_level = case_when(\n","    usage_day >= 0.75 ~ \"high usage\", \n","    usage_day >= 0.5 ~ \"medium usage\", \n","    usage_day >= 0.25 ~ \"low usage\", \n","    usage_day >= 0 ~ \"very low usage\"\n","    )\n","  )"]},{"cell_type":"markdown","id":"7219940c","metadata":{"papermill":{"duration":0.230343,"end_time":"2022-04-09T03:35:31.127554","exception":false,"start_time":"2022-04-09T03:35:30.897211","status":"completed"},"tags":[]},"source":["### Sleep efficiency \n","\n","Sleep efficiency a way to measure the quality of sleep. Calculated as the total asleep minutes / total time in bed. \n","\n","Sleep efficiency over 85% is a good sleep. "]},{"cell_type":"code","execution_count":14,"id":"e7c2bac2","metadata":{"execution":{"iopub.execute_input":"2022-04-09T03:35:31.591289Z","iopub.status.busy":"2022-04-09T03:35:31.589198Z","iopub.status.idle":"2022-04-09T03:35:31.614476Z","shell.execute_reply":"2022-04-09T03:35:31.61288Z"},"papermill":{"duration":0.261393,"end_time":"2022-04-09T03:35:31.614652","exception":false,"start_time":"2022-04-09T03:35:31.353259","status":"completed"},"tags":[]},"outputs":[],"source":["# Find sleep efficiency\n","dailySleep <- dailySleep %>% \n","  mutate(sleepEfficiency = TotalMinutesAsleep / TotalTimeInBed)\n","\n","# Identify good or bad sleep\n","dailySleep <- dailySleep %>% \n","  mutate(good_bad_sleep = case_when(\n","    sleepEfficiency <= 0.85 ~ \"bad sleep\", \n","    TRUE ~ \"good sleep\" \n","    )\n","  )"]},{"cell_type":"markdown","id":"59ada1a3","metadata":{"papermill":{"duration":0.262971,"end_time":"2022-04-09T03:35:32.107503","exception":false,"start_time":"2022-04-09T03:35:31.844532","status":"completed"},"tags":[]},"source":["### Merge dataframes "]},{"cell_type":"code","execution_count":15,"id":"ce74f99e","metadata":{"execution":{"iopub.execute_input":"2022-04-09T03:35:32.574031Z","iopub.status.busy":"2022-04-09T03:35:32.572012Z","iopub.status.idle":"2022-04-09T03:35:32.621678Z","shell.execute_reply":"2022-04-09T03:35:32.619958Z"},"papermill":{"duration":0.285342,"end_time":"2022-04-09T03:35:32.621919","exception":false,"start_time":"2022-04-09T03:35:32.336577","status":"completed"},"tags":[]},"outputs":[],"source":["# Merge daily dataframes  \n","dailyActivity <- dailyActivity %>% \n","  rename(date = ActivityDate)\n","\n","dailySleep <- dailySleep %>% \n","  rename(date = SleepDay)\n","\n","daily_merged <- merge(dailyActivity, dailyMET, by = c(\"Id\" , \"date\"))\n","\n","daily_merged <- merge(daily_merged, dailySleep, by = c(\"Id\", \"date\")) \n","\n","daily_merged <- merge(daily_merged, dailyIntensity, by = c(\"Id\", \"date\"))"]},{"cell_type":"markdown","id":"18812587","metadata":{"papermill":{"duration":0.227195,"end_time":"2022-04-09T03:35:33.076446","exception":false,"start_time":"2022-04-09T03:35:32.849251","status":"completed"},"tags":[]},"source":["### Recommended weekly exercise minutes "]},{"cell_type":"code","execution_count":16,"id":"7fd69cdc","metadata":{"execution":{"iopub.execute_input":"2022-04-09T03:35:33.536174Z","iopub.status.busy":"2022-04-09T03:35:33.53471Z","iopub.status.idle":"2022-04-09T03:35:33.558531Z","shell.execute_reply":"2022-04-09T03:35:33.557206Z"},"papermill":{"duration":0.255109,"end_time":"2022-04-09T03:35:33.558709","exception":false,"start_time":"2022-04-09T03:35:33.3036","status":"completed"},"tags":[]},"outputs":[],"source":["# Find user average weekly exercise minutes\n","weekly_exercise_minutes <- dailyActivity\n","weekly_exercise_minutes <- weekly_exercise_minutes %>% \n","  group_by(Id) %>% \n","  summarise(num_days = n_distinct(date), avg_weekly_exer_min = sum(adjusted_exercise_minutes) / num_days * 7 )"]},{"cell_type":"markdown","id":"20cbfc28","metadata":{"papermill":{"duration":0.232951,"end_time":"2022-04-09T03:35:34.018732","exception":false,"start_time":"2022-04-09T03:35:33.785781","status":"completed"},"tags":[]},"source":["# 4. Analyse and visualise \n","\n","## Support visualistions and key findings\n","\n","### Weekly MET minute pattern"]},{"cell_type":"code","execution_count":17,"id":"c129dcce","metadata":{"execution":{"iopub.execute_input":"2022-04-09T03:35:34.478439Z","iopub.status.busy":"2022-04-09T03:35:34.476918Z","iopub.status.idle":"2022-04-09T03:35:35.112902Z","shell.execute_reply":"2022-04-09T03:35:35.111926Z"},"papermill":{"duration":0.866646,"end_time":"2022-04-09T03:35:35.113039","exception":false,"start_time":"2022-04-09T03:35:34.246393","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["4003.85773157225"],"text/latex":["4003.85773157225"],"text/markdown":["4003.85773157