st(x, y, method = \"pearson\")\n","\n","# Plot total intensity vs sleep efficiency \n","ggplot(daily_merged, aes(x = total_int, y = sleepEfficiency)) + \n","  geom_point() + \n","  labs(x = \"Total intensity\",\n","       y = \"Sleep efficiency\") +\n","  labs(title = \"Total intensity vs Sleep efficiency\",\n","       subtitle = \"r = 0.065, => No correlation\") \n","\n","# Find correlation coefficient\n","x <- daily_merged$total_int\n","y <- daily_merged$sleepEfficiency\n","cor.test(x, y, method = \"pearson\")"]},{"cell_type":"markdown","id":"708c80d7","metadata":{"papermill":{"duration":0.298636,"end_time":"2022-04-09T03:35:45.316581","exception":false,"start_time":"2022-04-09T03:35:45.017945","status":"completed"},"tags":[]},"source":["Data shows there is no correlation between exercise duration, distance, number of steps, intensity and sleep efficiency. \n","\n","### Correction between calories burnt, adjusted exericse minutes and sleep efficiency "]},{"cell_type":"code","execution_count":24,"id":"e7466653","metadata":{"execution":{"iopub.execute_input":"2022-04-09T03:35:45.954178Z","iopub.status.busy":"2022-04-09T03:35:45.952473Z","iopub.status.idle":"2022-04-09T03:35:46.704873Z","shell.execute_reply":"2022-04-09T03:35:46.705436Z"},"papermill":{"duration":1.089726,"end_time":"2022-04-09T03:35:46.705641","exception":false,"start_time":"2022-04-09T03:35:45.615915","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["`geom_smooth()` using formula 'y ~ x'\n","\n"]},{"data":{"text/plain":["\n","\tPearson's product-moment correlation\n","\n","data:  x and y\n","t = 10.653, df = 276, p-value < 2.2e-16\n","alternative hypothesis: true correlation is not equal to 0\n","95 percent confidence interval:\n"," 0.4507782 0.6181819\n","sample estimates:\n","      cor \n","0.5397954 \n"]},"metadata":{},"output_type":"display_data"},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOz